import React, { Component } from 'react';

class ErrorPage extends Component {
  render() {
    return (
      <>
        <main>
          <h1>An error occurred!</h1>
          <p>Could not find this page!</p>
        </main>
      </>
    );
  }
}

export default ErrorPage;
